import React from "react"

function Chatbot (props) {
  return (
    <div>
      <header>
        Chatbot
      </header>
      <div>
        <Channels channels={props.data}/>
        <Chats />
      </div>
    </div>
  )
}

function Channels (props) {
  const channels = props.channels
  channels.map((channel, index) => {
    <Channel channel={channel} />
  })

  return (
    // <ul>
    //   {channels.map((channel, index) => {
    //     <Channel channel={props.channel[index]}/>
    //   })}
    // </ul>
    null
  )
}

function ChannelList (props) {
  return (
    <div>
      <Channel channel={props.channels[0]}/>
    </div>
  )
}

const Channel = props => (
  <button class channel-button>
    {props.channel.title} ||
    status: {props.channel.status}
  </button>
)

function Chats () {
  return (
    <div>
      <header>
        Chats
      </header>
    </div>
  )
}

export default Chatbot
